import axios from "axios";
import React from "react";
import useSWR from 'swr'
import './App.css';
const endpoint="http://localhost:4005/videos";
//istek yapacağımız Url adresi
//1.key yani url adresi,2.opsiyonel  fonksiyon parametre alır,3.olarak options parametresi verebilirsin default tanımlı olan özellikleri değiştirmek için {name:...} gibi değiştir.

const fetcher = url => fetch(url).then(r => r.json()) //fetch ve axios ile veriyi alabiliriz endpoiny=url oluyor 
const fetcherAxios=url=>axios.get(url).then(res=>res.data)

function App() {

const { datafetch,fetcherror } = useSWR(endpoint,fetcher);
const { data,isValidating,error } = useSWR(endpoint,fetcherAxios);

console.log(data)
console.log(isValidating)
if (error) return <h2>{error}</h2>
if(!data) return <h2>Loading</h2>
  return (
    <div className="App">

    </div>
  );
}

export default App;
